import cssui from 'css-ui'
var cssuiObj = css_ui__WEBPACK_IMPORTED_MODULE_0__;
var compatibilityData = [];
$(function () {
    
    
	var basicArr = [];
	var navArr = [];
	var formArr = [];
	var viewArr = [];
	var integrateArr = [];
	var otherArr = [];
	for (let key in cssuiObj) {
		var item = cssuiObj[key].compatibility;
		if (item) {
			switch (item.type) {
				case "基础组件":
					basicArr.push(item);
					break;
				case "导航组件":
					navArr.push(item);
					break;
				case "表单组件":
					formArr.push(item);
					break;
				case "视图组件":
					viewArr.push(item);
					break;
				case "集成使用":
					integrateArr.push(item);
					break;
				case "其他组件":
					otherArr.push(item);
					break;
				default: break;
			}
		}
	}
	compatibilityData = compatibilityData.concat(basicArr);
	compatibilityData = compatibilityData.concat(navArr);
	compatibilityData = compatibilityData.concat(formArr);
	compatibilityData = compatibilityData.concat(viewArr);
	compatibilityData = compatibilityData.concat(integrateArr);
    compatibilityData = compatibilityData.concat(otherArr);
})

export default compatibilityData
